        <p style='margin:0in;font-size:15px;font-family:"Calibri",sans-serif;'>Another risk to consider is that, since Gold-backed <strong>Digital Gold Coins&nbsp;</strong>are pegged to the price of gold, their &nbsp; value will go down &nbsp; if gold prices crash. Although &nbsp; this phenomenon is also a rare case, it is still a possibility of which the investors should be aware.</p>
